import React, {Component} from 'react'
import ApiRepository from '../Library/ApiRepositories'

class Blog{

    async GetMenu(event) {
        event.preventDefault();
        const response = await ApiRepository.GetMenu();
        if(response){
            console.clear()
            console.log(response)
            document.getElementById('data').append(response)
        }
        else{
            alert('Something Went Wrong');
        }
    }


    render(){
        return (
            <React.Fragment>
                <button onClick={event => this.GetMenu(event)}>Get Blog Data</button>
                <pre><div id="data"></div></pre>
            </React.Fragment>
        )
    }

}

export default Blog
